import React from 'react';
import { Row, Col } from 'react-bootstrap'

const Footer = () => {
    const style = {
        fontWeight: "300!important"
    }
    return (
        <Row>
            <Col>
                <div className="text-center">
                    <h5 style={style}>Developed by Dongwook Kim (dongwook224@naver.com)</h5>
                </div>
            </Col>
        </Row>
    )
}

export default Footer;
